  supplies_mop_swab_ecu_description:
    '\u0110\u01b0\u1ee3c l\xe0m t\u01b0 x\u01a1 vi m\u1ea3nh, gi\u1ebb lau m\xe1y h\xfat b\u1ee5i Roborock c\xf3 kh\u1ea3 n\u0103ng h\xfat n\u01b0\u1edbc v\xe0 gi\u1eef n\u01b0\u1edbc tuy\u1ec7t v\u1eddi. Ngh\u0129a l\xe0 gi\u1ebb lau c\xf3 th\u1ec3 \u01b0\u1edbt l\xe2u h\u01a1n nh\u01b0ng c\u0169ng \u0111\u1ec3 l\u1ea1i \xedt v\u1ec7t n\u01b0\u1edbc tr\xean s\xe0n nh\xe0 h\u01a1n. Gi\u1ebb lau c\u0169ng c\xf3 \u0111\u1ed9 ma s\xe1t cao, cho ph\xe9p l\xe0m s\u1ea1ch th\u1eadm ch\xed k\u1ef9 h\u01a1n. Tuy nhi\xean, hi\u1ec7u su\u1ea5t l\xe0m s\u1ea1ch c\xf3 th\u1ec3 gi\u1ea3m sau m\u1ed9t th\u1eddi gian d\xe0i s\u1eed d\u1ee5ng. Vui l\xf2ng thay th\u1ebf gi\u1ebb lau sau m\u1ed7i 3 \u0111\u1ebfn 6 th\xe1ng.',
  supplies_mop_swab_shake_description:
    'Gi\u1ebb lau rung c\u1ee7a m\xe1y h\xfat b\u1ee5i Roborock c\xf3 thi\u1ebft k\u1ebf g\u1ed3m hai v\xf9ng. V\xf9ng rung c\xf3 nhi\u1ec7m v\u1ee5 lo\u1ea1i b\u1ecf v\u1ebft b\u1ea9n tr\xean s\xe0n nh\xe0 c\xf2n v\xf9ng l\u01b0u tr\u1eef c\xf3 nhi\u1ec7m v\u1ee5 gom b\u1ee5i b\u1ea9n v\xe0 l\xe0m s\u1ea1ch v\u1ec7t n\u01b0\u1edbc. \u0110\u01b0\u1ee3c l\xe0m t\u1eeb polyester v\xe0 nylon, gi\u1ebb lau n\xe0y c\xf3 kh\u1ea3 n\u0103ng v\u1eeba lo\u1ea1i b\u1ecf b\u1ee5i b\u1ea9n v\u1eeba gi\u1eef l\u1ea1i b\u1ee5i b\u1ea9n. Tuy nhi\xean, hi\u1ec7u su\u1ea5t l\xe0m s\u1ea1ch c\xf3 th\u1ec3 gi\u1ea3m sau m\u1ed9t th\u1eddi gian d\xe0i s\u1eed d\u1ee5ng. Vui l\xf2ng thay th\u1ebf gi\u1ebb lau sau m\u1ed7i 3 \u0111\u1ebfn 6 th\xe1ng.',
